import { useContext } from "react";
import { todoContext } from "../todoContext";
import { ListStyle, Task } from "./liststyle";

export default function ListTask() {
  const [todos] = useContext(todoContext);

  return (
    <ListStyle>
      {todos.map((value, key) => (
        <Task key={key}>{value.task}</Task>
      ))}
    </ListStyle>
  );
}
